import React from 'react';
import './AgentPerformanceRecords.css';

const imgContentPaste = "http://localhost:3845/assets/ef6e5e33bf0c7a55016af261878a9906b26dd5b9.svg";
const imgProcessing = "http://localhost:3845/assets/8f05e96a0b2fcbd4a99aa6970b48c8ebc9cf91ee.png";

function AgentPerformanceRecords({ files = [] }) {
  return (
    <div className="performance-records-container">
      <div className="performance-header">
        <div className="content-paste-icon">
          <img src={imgContentPaste} alt="" />
        </div>
        <h2>Agent Performance Records</h2>
      </div>

      <div className="performance-table">
        <div className="table-header">
          <div className="header-cell agent-header">AGENT</div>
          <div className="header-cell file-header">RECORDING FILE</div>
          <div className="header-cell date-header">DATE</div>
          <div className="header-cell score-header">PERFORMANCE SCORE</div>
          <div className="header-cell status-header">STATUS</div>
        </div>

        <div className="table-body">
          {files.map((file, index) => (
            <div key={file.id || index} className="table-row">
              <div className="cell agent-cell">
                {file.agentName === '-' ? '-' : file.agentName}
              </div>
              <div className="cell file-cell">
                {file.name}
              </div>
              <div className="cell date-cell">
                {new Date().toLocaleDateString('en-US', { 
                  month: 'short', 
                  day: 'numeric', 
                  year: 'numeric' 
                })}
              </div>
              <div className="cell score-cell">
                - / 100
              </div>
              <div className="cell status-cell">
                <img src={imgProcessing} alt="" className="processing-icon" />
                <span>Processing....</span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default AgentPerformanceRecords;
